  false,\n\t\"url\": null,\n\t\"notes\": \"This report contains locations and water
  use at Browns Park NWR for 1988. A general background is presented first with water
  rights information, management considerations, and lastly habitat considerations.
  Data for each diversion/impoundment at Browns Park NWR is supplied. This data includes
  the high and low each feature, the difference between the two and total water used.
  Following the data is a brief summary of water use at the diversion/impoundment,
  and then by another short paragraph highlighting any important wildlife use seen
  over the year. Additionally a proposed management plan for the following year is
  presented.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
